#!/usr/bin/env python3
import sys


def solve(N: int, M: int, K: int, A: "List[int]", B: "List[int]", C: "List[int]", D: "List[int]"):
    uf = UnionFind(N+1)
    for a, b in zip(A, B):
        uf.union(a, b)
    fr = [uf.size(i)-1 for i in range(N+1)]
    for a, b in zip(A, B):
        fr[a] -= 1
        fr[b] -= 1
    for c, d in zip(C, D):
        if not uf.same(c, d):
            continue
        fr[c] -= 1
        fr[d] -= 1
    return fr[1:]


